import React from 'react'
import { Link } from 'react-router-dom';

import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import CardDeck from 'react-bootstrap/CardDeck'
import Col from 'react-bootstrap/Col'

export default ({ random }) => {

    return (
        <>
            {
                random.map(randomRecipe => (
                    <CardDeck key={randomRecipe.id}>
                    <Col>
                    <Card bg="dark" text="light" style={{ width: '18rem' }}>
                        <Card.Img variant="top" src={randomRecipe.image} />
                        <Card.Body>
                            <Card.Title>{randomRecipe.title}</Card.Title>
                            <Card.Text>
                                {randomRecipe.creditsText}
                            </Card.Text>
                            <Button variant="primary">
                            <Link to={{
                                    pathname: `/recipe/${randomRecipe.id}`,
                                    recipe: {
                                        id: randomRecipe.id,
                                        title: randomRecipe.title,
                                        image: randomRecipe.image
                                    }
                                }} style={{color: "white"}}>Get Recipe</Link>
                            </Button>
                        </Card.Body>
                    </Card>
                    </Col>
                    </CardDeck>
                ))
            }
        </>
    )
}
